   // Function to perform search
        function searchData() {
            const searchQuery = document.getElementById('textSearch').value.trim().toLowerCase();
            const filteredResults = data.filter(item => {
                return Object.values(item).some(value => value.toLowerCase().includes(searchQuery));
            });
            displayResults(filteredResults);
        }

        // Function to display search results
        function displayResults(results) {
            const tableBody = document.getElementById('tableBody');
            tableBody.innerHTML = ''; // Clear previous results

            if (results.length === 0) {
                tableBody.innerHTML = '<tr><td colspan="7">Aucune correspondance trouvee.</td></tr>';
            } else {
                results.forEach(result => {
                    const row = document.createElement('tr');
                    row.innerHTML = `
                        <td>${result.lpn}</td>
                        <td>${result.code}</td>
                        <td>${result.libelle}</td>
                        <td>${result.organisme}</td>
                        <td>${result.type}</td>
                        <td align='center'>
                            <a href='?action=edit&user=1&prs=40&find=&id=${result.id}' 
                               style='background: #2baf6d; text-decoration: none; color: #fff;' 
                               class='tbutton'>
                               <i class='fas fa-edit'></i>
                            </a>
                        </td>
                        <td align='center'>
                            <span class='tbutton fas fa-trash' style='background: #af2b37; color: gray;'></span>
                        </td>
                    `;
                    tableBody.appendChild(row);
                });
            }
        }

        // Add event listener to detect Enter key press
        document.getElementById('textSearch').addEventListener('keydown', function(event) {
            if (event.key === 'Enter') {
                event.preventDefault(); // Prevent default form submission if inside a form
                searchData(); // Call the search function
            }
        });

        // Initialize the table with all data on page load
        displayResults(data);
    </script>
